CheatBook (10/2007) - Issue October - A Cheat-Code Tracker with Hints for several 
popular PC Action and adventure Games. 176 PC Games, 13 Walktroughs for PC and 
238 Console Cheats are represented in this new version from Strategy Games, 
Adventure Games to Action Games. This Database represents all genres and focuses 
on recent releases. Games are listed alphabetically in the left-hand window. 
When you highlight a game, the relevant cheat is displayed in the right-hand 
window, with convenient buttons that let you print the selection or save any 
changes you&amp;#039;ve made. If you need help with the latest and greatest games, CheatBook should be a big help. If you have installed the CheatBook-DataBase 2001 v4.0, CheatBook-DataBase 2002, CheatBook-DataBase 2003/ 2004 /2005/ 2006 or the new CheatBook-DataBase 2007, you will be able to update your DataBase directly. &lt;a href=&quot;
